import React, { Component } from 'react';
import Reactotron  from 'reactotron-react-js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import ShiftDetails from './Pages/Shift_Details/ShiftDetails.js';
import TroopDashboard from './Pages/Dashboard/TroopDashboard.js';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  state = {test: true};

  render(){
    console.log("this.state 2", this.state)
    Reactotron.log('hello rendering world', this.state)



    return (
      <div className="App">
        <header className="App-header">
          <BrowserRouter>
            <div>
              <ul>
                <li>
                  <Link to="ShiftDetails">Shift Details</Link>
                </li>
                <li>
                  <Link to="Dashboard">Dashboard</Link>
                </li>
              </ul>
            </div>
            <hr />
            <switch>
              <Route exact path="/shiftDetails">
                <ShiftDetails />
              </Route>
              <Route exact path="/dashboard">
                <TroopDashboard/>
              </Route>
            </switch>
          </BrowserRouter>
        </header>
      </div>
    );
  }

}

export default App;
